import React, { useContext } from 'react';
import { ThemeContext } from '../Contexts';
import Main from '../components/Main';

function Home() {
  const { theme, query } = useContext(ThemeContext);

  return (
    <div style={{ backgroundColor: theme === 'light' ? '#f8f9fa' : '#212529', color: theme === 'light' ? 'light' : 'white' }}>
      <Main term={query} />
    </div>
  );
}

export default Home;
